  input: '"TEXT","F3XA","C00055582","This amendment is submitted in response to the
    Commissions inquiry dated August 1, 2007.  Item 1:  NYRSC SOLICITATION BEST EFFORT
    PROCEDURE  All solicitations clearly and conspicuously request (in type set identical
    or larger to that used in the rest of the solicitation) the following:  Name and
    Address, Employer, Occupation  All solicitations have the following disclaimer:  Contributions
    are not tax-deductible. The above information is required by FEC and/or State
    Laws.  Subject to the limits and prohibitions of the Federal Election Campaign
    Act, contributions will be deposited into the Federal Account for use in Federal  elections
    and other proper expenditures therefrom.  The requested information is required
    by FEC and/or State Election Laws.  Federal election laws require  us to use our
    best efforts to collect and report the name, mailing address, occupation and name
    of employer of individuals whose contributions exceed $200 in  a calendar year.  Paid
    for by N.Y. Republican State Committee.  All contributors which do not provide
    the requested information are then mailed a follow-up letter and encloses a business
    reply envelope.    All information received is then reported and, if necessary,
    report amendments are filed.  Item 2. Any additional information received in response
    to our efforts to provide complete disclosure information is disclosed on the
    amended Schedule A."'
